import React from "react";
import "./ParallaxSection.css";

const ParallaxSection = () => {
  return (
    <div className="parallax">
      <h1>
        Happy Birthday
        <span className="heart"></span>
      </h1>
    </div>
  );
};

export default ParallaxSection;
